import React, { Component } from "react";

import {
    Badge,
    Card,
    CardHeader,
    CardBody,
    Col,
    Media,
    Table,
    Container,

    Row,
} from "reactstrap";


import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";
import { Redirect } from "@version/react-router-v3";
import axios from 'axios';





// const [disable,setDisable]=  useState(true);






var data = null;
const hello = (prop) => {
    data = prop;
    console.log(prop)
};

const rows = [];


export default class Recharge extends Component {


    constructor() {
        super();
        this.state = {
            filtered: []
        }
    }
    Changedate = (e) => {
        this.setState({
            startdate: e
            
        });
        console.log(this.state.startDate);
    };
    enddate = (e) => {
        this.setState({
            enddate: e
        });
    };





    componentDidMount = () => {
        var token = localStorage.getItem("token");
        if (token !== null || token !== undefined) {
            const myHeaders = new Headers();
            myHeaders.append("Authorization",
                "Bearer " + localStorage.getItem("token"));
            myHeaders.append("Content-Type", "application/json");
            var raw = JSON.stringify({
                "endDate": "2022-11-24",
                "startDate": "2022-08-02",
                "userId": ""
            });



            var requestOptions = {
                method: "POST",
                headers: myHeaders,
                body: raw,
                redirect: "follow",
            };
            let transactionUrl = "https://uat.softmintdigital.com/reportservice/transaction/transactionreport?pageNo=0&pageSize=20";
            fetch(transactionUrl,
                requestOptions
            )
                .then((response) => response.text())
                .then((result) => {
                    // data = null;
                    // hello(JSON.parse(result));
                    this.addList(JSON.parse(result))
                    console.log(JSON.parse(result))

                })
                .catch((error) => console.log(error));

        } else {
            this.props.history.push("/auth/login")
        }
    };
    onsubmit = (e) => {
        debugger;
        const data = { startdate: this.state.startdate, enddate: this.state.enddate };
        e.preventDefault();
        axios.post('https://uat.softmintdigital.com/reportservice/transaction/transactionreport?pageNo=1&pageSize=20', data).then(response => {
            console.log(response.data);
            this.setState({
                employeedata: response.data
            });
        });
    }

    addList = (response) => {
        const list = response.report;
        rows.length = 0;
        for (let i = 0; i < list.length; i++) {
            console.log("Itretion " + i + " Times");
            var lst = list[i];
            rows.push(
                <tr>
                    <th scope="row">
                        <Media className="align-items-center">
                            <Media>
                                <span className="mb-0 text-sm">{i + 1}</span>
                            </Media>
                        </Media>
                    </th>
                    <td>{lst.name}</td>
                    <td>
                        <Badge color="" className="badge-dot mr-4">
                            <i className="bg-warning" />
                            {lst.firmName}
                        </Badge>
                    </td>

                    <td>
                        <div className="avatar-group">
                            <span className="mr-2">{lst.wlnm}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.wlId}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.userId}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.transId}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.openingBal}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.credit}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.debit}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.closingBal}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.narration}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.remarks}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.adopbal}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.adclbal}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.date}</span>
                        </div>
                    </td>

                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.time}</span>
                        </div>
                    </td>
                    {/* <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.tranPin}</span>
                        </div>
                    </td> */}
                    {/* <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.wlId}</span>
                        </div>
                    </td> */}
                    {/* <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.lockedAmount}</span>
                        </div>
                    </td> */}
                    {/* <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.pan}</span>
                        </div>
                    </td> */}
                    {/* <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.aadhaar}</span>
                        </div>
                    </td> */}
                    {/* <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.panbalance}</span>
                        </div>
                    </td> */}

                </tr>
            );
        }
        console.log(rows);
    };

    render() {


        return (
            <>
                <div className="header bg-gradient-info pb-8 pt-5 pt-md-8">
                    <Container fluid>
                        <div className="header-body">
                            <Row>
                                <Col lg="12" xl="12">
                                    <Card className="card-stats mb-4 mb-xl-0">
                                        <CardBody>
                                            <Row>
                                                <Col lg="2" md="6">
                                                    <h4>Start Date: </h4>
                                                    <DatePicker className="form-control" selected={this.state.startdate} filtered={this.state.filtered} onChange={this.Changedate} placeholderText="Select Date" showPopperArrow={false}
                                                        onFilteredChange={filtered => this.setState({ filtered })} />
                                                    {/* <DatePicker className="form-control" selected={this.state.sdate} dateFormat="dd/MM/yyy"
                                                    onChange={this.selectDate}
                                                        placeholderText="DD-MM-YYYY"
                                                    /> */}


                                                </Col>
                                                <Col lg="2" md="6">
                                                    <h4>End Date: </h4>
                                                    <DatePicker className="form-control" selected={this.state.enddate} placeholderText="Select Date" showPopperArrow={false} onChange={this.enddate} />











                                                    {/* <DatePicker selected={this.state.edate} onChange={this.EndDate} dateFormat="dd/MM/yyy"
                                                     placeholderText="DD-MM-YYYY" /> */}
                                                </Col>
                                                <Col lg="2" md="6">
                                                    <h4>Search</h4>
                                                    <div>

                                                        <input
                                                            type="text"

                                                            className="form-control"
                                                            placeholder="Search"
                                                            style={{

                                                                marginBottom: "2px",
                                                            }}
                                                        ></input>
                                                    </div>
                                                </Col>
                                                <Col lg="2" md="6">
                                                    <button type="submit" className="btn btn-success"
                                                        style={{
                                                            backgroundColor: "#11cdef",
                                                            // height: "10px",
                                                            textAlign: "center",
                                                            display: "flex",
                                                            justifyContent: "center",
                                                            alignItems: "center",
                                                            marginTop: "30px",
                                                        }}
                                                        // className="btn-icon-clipboard"
                                                        data-clipboard-text="align-center"
                                                        id="tooltip662352101"
                                                    // type="button"
                                                    >
                                                        Search
                                                    </button>
                                                </Col>
                                                <Col lg="2" md="6">
                                                    <button type="submit" className="btn btn-success"
                                                        style={{
                                                            backgroundColor: "#11cdef",
                                                            // height: "10px",
                                                            textAlign: "center",
                                                            display: "flex",
                                                            justifyContent: "center",
                                                            alignItems: "center",
                                                            marginTop: "30px",
                                                        }}
                                                        // className="btn-icon-clipboard"
                                                        data-clipboard-text="align-center"
                                                        id="tooltip662352101"
                                                    // type="button"
                                                    >
                                                        Export
                                                    </button>
                                                </Col>
                                                <Col lg="2" md="6">
                                                    <button type="submit" className="btn btn-success"
                                                        style={{
                                                            backgroundColor: "#11cdef",
                                                            // height: "10px",
                                                            textAlign: "center",
                                                            display: "flex",
                                                            justifyContent: "center",
                                                            alignItems: "center",
                                                            marginTop: "30px",
                                                        }}
                                                        // className="btn-icon-clipboard"
                                                        data-clipboard-text="align-center"
                                                        id="tooltip662352101"
                                                    // type="button"
                                                    >
                                                        Export
                                                    </button>
                                                </Col>
                                            </Row>
                                            <p className="mt-3 mb-0 text-muted text-sm">
                                                <span className="text-success mr-2">

                                                </span>{" "}

                                            </p>
                                        </CardBody>
                                    </Card>
                                </Col>
                            </Row>
                        </div>
                    </Container>
                </div>

                <Container className="mt--7" fluid style={{ backgroundColor: "#" }}>
                    <Row className="mb--20">
                        <div className="col">
                            <Card className="shadow">
                                <CardHeader className=" border-0">
                                    <h3 className=" mb-0">Transiction Report</h3>
                                </CardHeader>
                                <Table className="align-items-center table-flush" responsive>
                                    <thead className="thead-light">
                                        <tr>
                                            <th scope="col">SR NO.</th>
                                            <th scope="col">name</th>
                                            <th scope="col"> firmName</th>
                                            <th scope="col">wlnm</th>
                                            <th scope="col">wlId</th>
                                            <th scope="col">userId</th>
                                            <th scope="col">transId</th>
                                            <th scope="col">openingBal</th>
                                            <th scope="col">credit</th>
                                            <th scope="col">debit</th>
                                            <th scope="col">closingBal</th>
                                            <th scope="col">narration</th>
                                            <th scope="col">remarks</th>
                                            <th scope="col">adopbal</th>
                                            <th scope="col">adclbal</th>
                                            <th scope="col">date</th>
                                            <th scope="col">time</th>

                                            <th scope="col" />
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {rows}
                                    </tbody>
                                </Table>
                            </Card>
                        </div>
                    </Row>
                </Container>
            </>
        );
    }
}
